async function setData(a,b,c){const d={method:"PUT",headers:{Authorization:"Bearer "+b,"Content-Type":"application/json"},body:JSON.stringify(c)},e=await fetch(a,d);if(!e.ok)throw new Error(`Could not fetch ${a}, received ${e.status}`);const f=await e.json();return localStorage.setItem("userData",JSON.stringify(f)),f}export default setData;